pt-br	messages:captcha-addurl	s:254:"Sua edição inclui novas ligações externas.\nPara prevenção contra sistemas automatizados que inserem spam, será necessário que você resolva a simples soma abaixo e entre com a resposta no respectivo campo ([[Special:Captcha/help|o que é isto?]])";
